import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const DATA = [
  { id: "1", name: "Practice using React's context API", completed: true, index: {index} },
  { id: "2", name: "Practice using custom hooks", completed: false },
  { id: "3", name: "Learn React routing", completed: false }
];

ReactDOM.render(
  <React.StrictMode>
    <App todos={DATA} />
  </React.StrictMode>,
  document.getElementById('root')
);
